import { StyleSheet } from 'react-native';
import { Colors } from '../../style/colors';

export const styles = StyleSheet.create({
    container: {
        padding: 50,
        alignContent: 'center',
        backgroundColor: Colors.timberwolf,
        flex: 1,
        height: '150%'
    }
})
